              ),
              Expanded(
                child: TabBarView(
                  children: tabs.map(
                    (Tab tab) => MyTab(
                      tab: tab.text!,
                      builder: (
                        BuildContext context,
                        int Function() methodFromChild,
                      ) {
                        showListLength = methodFromChild;
                      }
                    )
                  ).toList(),
                ),
              ),
            ],
          );
        }),
      ),
    );
  }
}

class MyTab extends StatefulWidget {

  final String tab;
  final MyBuilder builder;

  const MyTab({super.key, required this.tab, required this.builder});

  @override
  State<MyTab> createState() => MyTabState();
}

class MyTabState extends State<MyTab> {

  late final List<int> list;
  late final ValueNotifier<List<int>> selected;

  @override
  void initState() {
    list = widget.tab == 'First'
      ? List.generate(5, (index) => index)
      : List.generate(10, (index) => index);
    selected = ValueNotifier<List<int>>(list);

    print('init state was called');
    print('list length is ${list.length}');

    super.initState();
  }

  int showSelectedLength() => selected.value.length;

  @override
  Widget build(BuildContext context) {

    widget.builder.call(context, showSelectedLength);

    return ListView.builder(
      itemCount: list.length,
      itemBuilder: (_,index){
        return Container(
          color: Colors.black12,
          padding: const EdgeInsets.all(8),
          child: Center(child: Text(index.toString()))
        );
      });
  }
}

