vector<string> ans;

typedef struct node{
	int f;
	int value;
	int leaf;
	struct node *left;
	struct node *right;
}node;

int map[256] = {0};

bool cmp(node* A, node* B){
	if(A->f < B->f)
		return true;
	if(A->f == B->f && map[A->value] < map[B->value])
		return true;
	return false;
}

void traverse(node *root, string s){
	if(root->leaf != -1){
		ans[root->value] = s;
		return; 
	}
	traverse(root->left, s+"0");
	traverse(root->right, s+"1");
	return;
}

