typedef struct Node
{
    char* val;
    struct Node *left, *right;
} Node;
 
bool downstream(Node *root, int *values){
    if (root->left==NULL) return values[*(root->val)-'A'];
    if (*(root->val)=='!') return !downstream(root->left, values);
    bool left = downstream(root->left, values), right = downstream(root->right, values);
    if (strcmp(root->val, "&&")==0) return left&&right;
    else return left||right;
}
 
